import React from 'react';
import './TrainerDashboard.css'; // Optional: Create this CSS file or use inline styles

const TrainerDashboard = () => {
  return (
    <div className="dashboard-container">
      <h2>Trainer Dashboard</h2>
      <nav className="dashboard-nav">
        <ul>
          <li><a href="/create-plan">Create Plan</a></li>
          <li><a href="/view-groups">View Groups</a></li>
          <li><a href="/invite-trainee">Invite Trainee</a></li>
          <li><a href="/view-progress">View Progress</a></li>
        </ul>
      </nav>
    </div>
  );
};

export default TrainerDashboard;
